import axios from "axios";
import {React} from "react";


const baseURL = "http://localhost:3000/";

function getTitle() {
    //Call Server;
    alert('Calling Server');
    
    React.UseEffect(() => {
        axios.get(baseURL).then((response) => {
            alert(JSON.stringify(response));
        });
    }, []);

   
    return (
       'test'
    );

}

export default getTitle;
